import './App.css';
import { ThemeProvider, Container } from '@mui/system';
import { theme } from './themes/theme';
import { Grid } from '@mui/material';
import { BrowserRouter, Route, Routes } from "react-router-dom";

import Header from './components/Header';
import Footer from './components/Footer';
import Profile from './components/Profile';
import Resume from './pages/Resume';
import Portfolio from './pages/Portfolio';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Container>
        <Grid container item xs={12}>
          <Grid item xs={4} style={{backgroundColor: "orange"}}>
            <Profile />
          </Grid>
          <Grid container item xs={8}>
            <Grid container item style={{backgroundColor: "yellow"}}>
              <Header />
            </Grid>
            <Grid container item style={{backgroundColor: "green"}}>
              <BrowserRouter>
                <Routes>
                  <Route path='/' component={Resume} exact /> 
                  <Route path='/portfolio' component={Portfolio} />
                </Routes>
              </BrowserRouter>
            </Grid>
            <Grid container item style={{backgroundColor: "blue"}}>
              <Footer />
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default App;
